pragma solidity 0.5.7;
pragma experimental ABIEncoderV2;
 
import "./interfaces/ITrade.sol";
import "./interfaces/IPreTrade.sol";
import "./interfaces/IPostTrade.sol";
import "./registry/Security.sol";
import "./interfaces/IOrderPool.sol";
import "./interfaces/IPoolFactory.sol";
import "./interfaces/ViaCash.sol";
import "./interfaces/ViaFactory.sol";
import "./utilities/StringUtils.sol";
import "abdk-libraries-solidity/ABDKMathQuad.sol";
import "@openzeppelin/upgrades/contracts/Initializable.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/math/SafeMath.sol";

contract Trade is ITrade, Initializable {

    using ABDKMathQuad for uint256;
    using ABDKMathQuad for int256;
    using ABDKMathQuad for bytes16;

    using stringutils for *;

    using SafeMath for uint256;

    mapping(bytes32 => ITrade.order) private orders;

    bytes32[] orderRefs;

    mapping(bytes32 => ITrade.trade) private trades;

    bytes32[] tradeRefs;

    address settlement;
    address registration;
    address orderpool;
    address poolfactory;
    ViaFactory private via;

    function initialize(address _viaFactory, address _settlement, address _registration, address _orderpool, address _poolfactory) public initializer{
        settlement = _settlement;
        registration = _registration;
        orderpool = _orderpool;
        poolfactory = _poolfactory;
        via = ViaFactory(_viaFactory);
    }

    function reportTrade(ITrade.trade calldata newTrade, bytes32 partyRef, bytes32 counterpartyRef) external {
        require(IPoolFactory(poolfactory).confirmPool(msg.sender)==true);
        bytes32 _tradeRef = keccak256(abi.encodePacked(partyRef, counterpartyRef));
        tradeRefs.push(_tradeRef);
        trades[_tradeRef]=trade(newTrade.transferor, 
                                newTrade.transferee, 
                                newTrade.security,
                                newTrade.price,
                                newTrade.askprice, 
                                newTrade.currency, 
                                newTrade.order,
                                newTrade.stype,
                                newTrade.qty, 
                                newTrade.dt);   
        (bytes32 _isin, bytes32 _company, address _token) = IPreTrade(registration).getSecurity(newTrade.security);
        if(newTrade.stype=="DP"){
            bytes32 _transfereeDPID = IPreTrade(registration).getDP(newTrade.transferee);
            bytes32 _transferorDPID = IPreTrade(registration).getDP(newTrade.transferor);
            IPostTrade.settlement memory tradeToSettle = IPostTrade.settlement({
                transferor : newTrade.transferor,
                transferee : newTrade.transferee,
                security : newTrade.security,
                securityName : Security(trades[_tradeRef].security).name().stringToBytes32(),
                status : "Pending",
                transferorDPID : _transferorDPID,
                transfereeDPID : _transfereeDPID,
                isin : _isin,
                company : _company,
                currency : newTrade.currency,
                price : newTrade.price,
                consideration : SafeMath.mul(newTrade.price, newTrade.qty),
                unitsToTransfer : newTrade.qty,
                executionDate : now
            });            
            IPostTrade(settlement).postSettlement(tradeToSettle, _tradeRef);
        }
        else if(newTrade.stype=="STP"){
            (address cashToken, ) = via.getAddressAndType(newTrade.currency);
            if(ViaCash(cashToken).transferFrom(newTrade.transferee, newTrade.transferor, SafeMath.mul(newTrade.price, newTrade.qty))){
                bool success = Security(_token).transferFrom(newTrade.transferor, newTrade.transferee, newTrade.qty);
                if(!success){
                    IOrderPool(msg.sender).revertTrade(partyRef, newTrade.qty, "sell");
                    IOrderPool(msg.sender).revertTrade(counterpartyRef, newTrade.qty, "buy");
                    ViaCash(cashToken).transferFrom(newTrade.transferor, newTrade.transferee, SafeMath.mul(newTrade.price, newTrade.qty));
                }
            }
        }
    }

    //returns bid, ask, last change corresponding to passed order ref
    function getTrade(bytes32 ref) external view returns(uint256 b, uint256 a){
        require(orders[ref].party==msg.sender);
        uint i;
        uint256 bid=0;
        uint256 ask=0;
        for(i=0; i<tradeRefs.length; i++){
            if(trades[tradeRefs[i]].security==orders[ref].security && trades[tradeRefs[i]].order=="Buy"){
                bid = trades[tradeRefs[i]].price;
                ask = trades[tradeRefs[i]].askprice;
            }
            if(trades[tradeRefs[i]].security==orders[ref].security && trades[tradeRefs[i]].order=="Sell"){
                ask = trades[tradeRefs[i]].price;
                bid = trades[tradeRefs[i]].askprice;
            }
        }
        return (bid, ask);
    }

    function reportOrder(ITrade.order calldata newOrder, bytes32 ref) external {
        require(IPoolFactory(poolfactory).confirmPool(msg.sender)==true);
        if(orders[ref].party==address(0x0)){
            orderRefs.push(ref);
            orders[ref].party = newOrder.party;
            orders[ref].price = newOrder.price;
            orders[ref].trigger = newOrder.trigger;
            orders[ref].qty = newOrder.qty;
            orders[ref].order = newOrder.order; 
            orders[ref].otype = newOrder.otype;
            orders[ref].dt = newOrder.dt;
            orders[ref].status = newOrder.status;
            orders[ref].currency = newOrder.currency;
            orders[ref].securityName = newOrder.securityName;
            orders[ref].security = newOrder.security;
        }
    }

    function getOrders(bool originator) external view returns(bytes32[] memory){
        uint entries = orderRefs.length;
        bytes32[] memory result = new bytes32[](entries);
        uint entry=0;
        uint i;
        if(originator){
            for(i=0; i<orderRefs.length; i++){
                if(orders[orderRefs[i]].party==msg.sender){
                    result[entry]=orderRefs[i];
                    entry=entry+1;
                }
            }
        }
        else{
            for(i=0; i<orderRefs.length; i++){
                if(orders[orderRefs[i]].party!=msg.sender){
                    result[entry]=orderRefs[i];
                    entry=entry+1;
                }
            }
        }
        return result;
    }

    function getOrder(bytes32 ref) external view returns(ITrade.order memory){
        ITrade.order memory response = ITrade.order({
            party : orders[ref].party,
            security : orders[ref].security,
            price : orders[ref].price,
            trigger : orders[ref].trigger, 
            otype : orders[ref].otype,
            order : orders[ref].order,
            status : orders[ref].status,
            currency : orders[ref].currency,
            securityName : orders[ref].securityName,
            qty : orders[ref].qty,
            dt : orders[ref].dt
        });
        return(response);
    }   

    function editOrder(ITrade.order calldata currentOrder, bytes32 ref) external{
        require(IPoolFactory(poolfactory).confirmPool(msg.sender)==true);
        if(orders[ref].party!=address(0x0)){
            orders[ref].party = currentOrder.party;
            orders[ref].price = currentOrder.price;
            orders[ref].trigger = currentOrder.trigger;
            orders[ref].qty = currentOrder.qty;
            orders[ref].order = currentOrder.order; 
            orders[ref].otype = currentOrder.otype;
            orders[ref].dt = currentOrder.dt;
            orders[ref].status = currentOrder.status;
            orders[ref].currency = currentOrder.currency;
            orders[ref].securityName = currentOrder.securityName;
            orders[ref].security = currentOrder.security;
        }
    }

    function cancelOrder(bytes32 _ref, bytes32 _status) external{
        require(IPoolFactory(poolfactory).confirmPool(msg.sender)==true);
        if(orders[_ref].party!=address(0x0)){
            orders[_ref].status = _status;
        }
    }
    
}
